import numpy as npimport matplotlib.pyplot as pltfrom scipy import linalg as LAfrom time import perf_counter as timerN=np.arange(1,50_000,100)rng = np.random.default_rng()t1 = []    for n in N:    A = rng.random((n,n))    b = np.ones((n,1))    start = timer()    x1 = LA.solve(A, b)    end = timer()    t1.append(end-start)    plt.plot(N,t1, '-ro')plt.xlabel('Matrix dimension')plt.ylabel('Time (s)')plt.legend(['linalg.solve(A, b)'])plt.grid('on')plt.show()